        SmallCap
    }

    struct PoolConfiguration {
        uint256 targetPriceDelta; // Stable: +/- 1%, BlueChip: +/- 10%, SmallCap: +/- 50%
        uint256 narrowRange; // 40%
        uint256 midRange; // 100%
        uint256 wideRange; // 170%
